const HomePage = () => {

  return (
    <>
      <Header />
      <View style={styles.container}>
        <Text>Recommendations</Text>
        {/* <Canvas style={{ background: "#171717" }}>
          <Suspense fallback={null}>
            <Human />
          </Suspense>
        </Canvas> */}
        <Button title="Sign Out" onPress={() => signOut(auth)} />
